import React from 'react';
import { Link } from 'react-router-dom';

export default function Header() {
  return (
    <header className="flex justify-between items-center px-8 py-6 max-w-6xl mx-auto w-full">
      <div className="flex items-center gap-3">
        <span className="w-12 h-12 flex items-center justify-center">
          <img src="/logo-pack/novaweb-logo-original.png" alt="Logo NovaWeb" className="w-12 h-12 object-contain" />
        </span>
        <span className="text-3xl font-bold tracking-tight font-sans">NovaWeb</span>
      </div>
      <nav aria-label="Menu principal">
        <ul className="flex gap-8 text-lg font-semibold tracking-wide font-sans">
          <li><Link to="/" className="header-link">Accueil</Link></li>
          <li><Link to="/services" className="header-link">Services</Link></li>
          <li><Link to="/novaMethode" className="header-link">NovaMéthode</Link></li>
          <li><Link to="/about" className="header-link">À propos</Link></li>
          <li><Link to="/contact" className="header-link">Contact</Link></li>
        </ul>
      </nav>
    </header>
  );
}
